import styles from "./UserItem.module.css";
import React from "react";
import Card from "../UI/Card";

const UserItem = (props) => {
  return(
  <li>
    <Card>
      <div>
        <p>{props.username} ({props.age} years old</p>
      </div>
    </Card>
  </li>
  )
};

export default UserItem;
